  //     </p>
  //   </div>
  // );

  return (
    <div className={classes.root}>
      <Login />
      <Singup />
      {/* <Button
        type='button'
        onClick={handleOpenSingUp}
        variant="outlined" 
        color="secondary">

        Sing Up
        </Button> */}
    </div>

  )
}

export default Start
